import React from "react";
import styled from "styled-components";
import { Button as B } from "./Main.elements";
const getItSection = () => {
  const Container = styled.div`
    display: flex;
    background-color: var(--green);
    gap: ${({ gap }) => gap && gap + "rem"};
    flex-direction: column;
    justify-content: center;
    align-items: center;
  `;
  const Row = styled.div`
    display: flex;
    gap: ${({ gap }) => gap && gap + "rem"};
    flex-direction: ${({ col }) => col && "column"};
  `;
  const Button = styled(B)``;
  return (
    <div>
      <Container gap={2}>
              <Row>
                  <p>

                  </p>
                  Get it on Playstore and download on Appstore</Row>
        <Row gap={3}>
          {" "}
          <Button google={true}>
            <Row>
              <img src="images/googlePlay.svg" alt="" />
            </Row>
            <Row col>
              <p>Get it on</p>
              <p>Play store</p>
            </Row>
          </Button>
          <Button>
            <Row>
              <img src="images/app.svg" alt="" />
            </Row>
            <Row col>
              <p>Get it on</p>
              <p>App store</p>
            </Row>
          </Button>
        </Row>
      </Container>
    </div>
  );
};

export default getItSection;
